@BuildIntoGames If something bad happens to your child in Roblox this is the kind of response you will get from them. They will not get involved.

They do not give you the tools to track this information on your own. There are no logs you can access.

If you are the victim of an exploit, too bad

@BuildIntoGames I asked Roblox if they could tell me who was playing on the same server at that time. They said they would not.

I asked Roblox if they could tell me what was said in chat. They said they would not.

I asked Roblox to tell me how to contact the creator. They said they would not.
